(162, 'sp_siteoffline_options', 'a:3:{s:7:"enabled";b:0;s:7:"content";s:1409:"<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n<title>DAEItaly | Sito in costruzione</title>\r\n<meta name="description" content="" />\r\n<meta name="keywords" content="" />\r\n\r\n<style type="text/css">\r\n* { margin:0; padding:0}\r\n\r\nbody {	\r\n	font-family:Arial, sans-serif;	\r\n	color:#999;\r\n       border-top:10px solid #d53c3c\r\n}\r\n\r\na {\r\n    color: #d53c3c;\r\n    text-decoration: none;\r\n    transition: color .3s, background .3s;\r\n    -o-transition: color .3s, background .3s;\r\n    -webkit-transition: color .3s, background .3s;\r\n    -moz-transition: color .3s, background .3s;  \r\n}\r\n\r\na:hover {\r\n    color: #000;\r\n    text-decoration: none;\r\n}\r\n\r\nimg {\r\n	border:none\r\n}\r\n\r\nh1,h2,h3,h4 {	\r\n        font-family: Arial;\r\n        color:#d53c3c;\r\n        margin-bottom: 20px;\r\n        font-size: 24px;\r\n}\r\n\r\n\r\n\r\n.logo {\r\n    margin-bottom: 20px\r\n}\r\n\r\n</style>\r\n\r\n</head>\r\n\r\n<body>\r\n\r\n\r\n\r\n<div align="center" style="margin: 40px 0">\r\n    <img src="http://www.daeitaly.com/wp-content/themes/dae/img/logo.png" class="logo" alt=""/>\r\n\r\n<h1>Sito in Costruzione</h1>\r\n<p>per maggiori informazioni: <a href="mailto:info@daeitaly.com">info@daeitaly.com</a></p>\r\n<p><i>Ci vediamo presto!</i></p>\r\n\r\n</div>\r\n\r\n\r\n</body>\r\n</html>\r\n";s:7:"version";d:1;}', 'yes'),
