(34739, '_transient_dash_4077549d03da2e451c8b5f002294ff51', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2016/02/contributor-weekend-one-hour-video/''>Contributor Weekend: One-Hour Video</a> <span class="rss-date">26 febbraio 2016</span><div class="rssSummary">It’s time for our second global contributor weekend, and this time we’re focusing on the video team. For this month’s challenge, in honor of it being our second month, you have two options for how you can participate! The challenge for this month overall is to work with at least one hour worth of WordCamp video, which [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://wptavern.com/axe-an-open-source-javascript-library-for-automating-accessibility-testing''>WPTavern: aXe: An Open Source JavaScript Library for Automating Accessibility Testing</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/stripe-payment-gateway-for-woocommerce-is-now-available-for-free''>WPTavern: Stripe Payment Gateway for WooCommerce Is Now Available for Free</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/mandrill-to-discontinue-free-tier-for-transactional-emails-developers-seek-alternatives''>WPTavern: Mandrill to Discontinue Free Tier for Transactional Emails, Developers Seek Alternatives</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Plugin popolari:</span> <a href=''https://wordpress.org/plugins/ml-slider/'' class=''dashboard-news-plugin-link''>Meta Slider</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=ml-slider&amp;_wpnonce=389d91e446&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Meta Slider''>Installa</a>)</span></li></ul></div>', 'no'),
