(420, 132, 'informazioni_aggiuntive_elenco_caratteristiche', 'Unità di Controllo UA10: è un’interfaccia utente di semplice uso che consente l’impostazione dei parametri di controllo secondo fasce orarie. E’ preposto al controllo di una zona climatica. Può essere completato con dispositivi per la gestione remota tramite SMS.\r\nTermostato ambiente TSRM : è un termostato semplice e funzionale che consente di incrementare o diminuire di 6°C il set point operativo sull’unità UA10, così da regolare in modo indipendente la zona preposta.\r\nScheda di Controllo: è una dispositivo elettronico multi funzionale, a barra DIN, per regolazione in modalità di riscaldamento e raffrescamento.\r\nAlimentatore ALI3010 : consente di alimentare il sistema a 12 Vcc. Dispone inoltre di secondario a 5 Vcc per eventuale alimentazione esterna del contatore SND15.\r\nSistema carta prepagata CRL100 : dispositivo che consente di gestire impianti a contabilizzazione deducendo dal credito residuo della carta l’importo dovuto al consumo secondo il costo energetico unitario impostato.\r\nSistema monitoraggio GSM100 : grazie a tale apparecchiatura è possibile la gestione remota dell’impianto tramite messaggi SMS. E’ inoltre possibile la supervisione a mezzo PC remoto nonché lo scarico consumi in impianti a contabilizzazione.'),
