(308, 100, 'informazioni_aggiuntive_elenco_caratteristiche', 'Ventilazione controllata in funzione della richiesta con sensore umidità integrato\r\nBypass per freecooling estivo\r\nAlta efficienza fino al 95%\r\nMotori elettrici a commutazione elettromagnetica (EC) a basso consumo energetico (basso SFP)\r\nFacilità di installazione con prese di pressione per misura portata aria e conseguente regolazione\r\nScambiatori a flusso incrociato in alluminio ad alta efficienza\r\nBassa perdita di carico\r\nTutti i modelli sono in conformità con le direttive in materia di sicurezza al fuoco specificate nella EN 12501 classe E. L’indice di perdita (interna ed esterna) è inferiore al 3% come specificato nella EN 308.\r\nCertificazione PassivHaus.'),
