INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(1, 1, '2013-12-09 15:22:53', '2013-12-09 15:22:53', 'Benvenuto in WordPress. Questo è il tuo primo articolo. Modificalo o cancellalo e inizia a creare il tuo blog!', 'Ciao mondo!!', '', 'publish', 'open', 'open', '', 'ciao-mondo', '', '', '2013-12-09 15:22:53', '2013-12-09 15:22:53', '', 0, 'http://www.daeitaly.com/?p=1', 0, 'post', '', 1),
(2, 1, '2013-12-09 15:22:53', '2013-12-09 15:22:53', 'Questa è una pagina di esempio. Differisce da un articolo di blog per rimane in un solo posto ed appare nel menu di navigazione del sito (questo nella maggior parte dei temi). Molte persone iniziano con una pagina di Info che li introduce ai potenziali visitatori del sito. Tale pagina potrebbe contenere un testo del tipo:\n\n<blockquote>Salve! Sono un pony express di giorno, un aspirante attore di notte e questo è il mio blog. Vivo a Los Angeles, ho un gran bel cane di nome Jack e mi piace la pi&#241;a coladas. (E infradiciarmi sotto la pioggia.)</blockquote>\n\n...o cose di questo genere:\n\n<blockquote>La XYZ Doohickey Company è stata fondata nel 1971, e ha fornito doohickeys di qualità al pubblico fin d''allora. Si trova a Gotham City, XYZ impiega oltre 2,000 persone e produce ogni genere di cose impressionanti per la comunità di Gotham.</blockquote>\n\nDa nuovo utente WordPress puoi andare sulla <a href="http://www.daeitaly.com/wp-admin/">tua bacheca</a> per cancellare questa pagina e creare nuove pagine per i tuoi contenuti. Buon divertimento!', 'Pagina di esempio.', '', 'publish', 'open', 'open', '', 'pagina-di-esempio', '', '', '2013-12-09 15:22:53', '2013-12-09 15:22:53', '', 0, 'http://www.daeitaly.com/?page_id=2', 0, 'page', '', 0),
(310, 1, '2016-03-01 17:16:43', '2016-03-01 16:16:43', '<p>DAE srl sarà presente alla 40° fiera “<em>MCE mostra convegno Expocomfort</em>”  che si terrà dal 15 al 18 Marzo 2016, presso il polo espositivo "Fieramilano"<br />\nIl nostro staff sarà lieto di accoglierVi nel <strong>padiglione 5, stand F09</strong></p>\n<p><a href="http://www.daeitaly.com/wp-content/uploads/2013/12/mce-date-oriz.png"><img class="alignnone size-full wp-image-339" src="http://www.daeitaly.com/wp-content/uploads/2013/12/mce-date-oriz.png" alt="mce-date-oriz" width="340" height="250" /></a></p>\n', 'News', '', 'inherit', 'closed', 'closed', '', '15-autosave-v1', '', '', '2016-03-01 17:16:43', '2016-03-01 16:16:43', '', 15, 'http://www.daeitaly.com/15-autosave-v1/', 0, 'revision', '', 0),
