(138, 1, '2014-01-13 11:24:09', '2014-01-13 10:24:09', 'DAE Energia propone soluzioni integrate di solare termico a circolazione forzata composte da un insieme di elementi necessari alla realizzazione dell’impianto che consentono una estrema flessibilità di installazione (grazie alle numerose combinazioni possibili realizzabili per soddisfare le specifiche esigenze di produzione di ACS e integrazione al riscaldamento). I collettori DAE Energia si addicono particolarmente alle installazioni in batteria per la realizzazione di impianti di media e grande potenza. L’alta qualità dei materiali impiegati e dei componenti oltre che alle elevate prestazioni, garantiscono affidabilità e durata nel tempo. Nei collettori DAE Energia PSX l’assorbitore è a superficie totale con giunto tecnico originale “OMEGA”, che consente un efficientissimo sfruttamento della superficie: i tubi collettori in rame risultano interamente avvolti in modo uniforme. Ciò evita le turbolenze d’aria nel collettore ottimizzando l’efficienza termica solare del vetro di copertura. Sono disponibili varie tipologie di accumulo inerziale, per sola acqua calda, per produzione integrata acs e riscaldamento per soddisfare le più svariate esigenze. Giunto tecnico originale “OMEGA”. Tubi avvolti - Trasferimento del calore più efficiente', 'Pannelli solari', '', 'publish', 'closed', 'closed', '', 'pannelli-solari', '', '', '2014-01-29 15:42:44', '2014-01-29 14:42:44', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=138', 0, 'prodotti', '', 0),
