(259, 1, '2014-02-19 11:33:40', '2014-02-19 10:33:40', '', 'Heat Interface Units', 'The DAE Heat Interface Units have been designed to provide apartments and communal housing developments with independent hot water and high efficiency heating.\r\nThe complete range of models available, suits a variety of applications such as:\r\n• Small flats\r\n• Communal housing developments\r\n• Large luxury apartments\r\n• Sheltered accommodation\r\nConsisting of a fast recovery hot water tank or high capacity heat exchanger, with a hydraulic header or plate heat exchanger, pump and mixing valve set for the heating circuit, DAE HIU''s offer a total heating solution. In addition to this the DAE units can provide direct control of underfloor heating without the need for any underfloor pumps, blending valves or mixing valves.\r\nThe design of the HIU''s provides the end user with the same autonomy as if they had their own boiler. This includes a meter for billing of energy usage and cold water consumption for each apartment or house, and where required it also offers a facility for both heating and cooling.\r\nDAE HIU''s draw energy from the main heating primary circuit delivered from a centralised plant room. This is in line with latest legislation encouraging centralised plant rather than the use of individual heating and hot water systems.\r\nThe integrated energy meter can be tailored to meet the requirements of the building operator and residents, ranging from simple read-only meters, to a complete remote billing solution using BUS communication to provide the end user with a fully itemised energy bill.', 'inherit', 'open', 'open', '', '258-autosave-v1', '', '', '2014-02-19 11:33:40', '2014-02-19 10:33:40', '', 258, 'http://www.daeitaly.com/258-autosave-v1/', 0, 'revision', '', 0),
(17, 1, '2014-01-28 17:42:14', '2013-12-09 15:53:03', 'Il settore della climatizzazione vede sul mercato la presenza di diverse proposte che assemblano prodotti non perfettamente integrati tra loro. Da qui sorge la pressante richiesta da parte degli addetti ai lavori di sistemi che combinino efficienza e funzionalità ad economicità.\r\n\r\n<b>DAE ENERGIA</b>, realtà imprenditoriale giovane e dinamica, in ragione di uno staff competente e innovativo, ha il piacere di presentarVi il nuovo progetto <b>Fare Comfort</b>, approccio integrato e completo, tecnologicamente avanzato, nella fase di progettazione e realizzazione di impianti per la climatizzazione civile.\r\n\r\n<b>Fare Comfort</b> è un nuovo modo di concepire il sistema edificio impianto dove si prevedono tre livelli di attività:\r\n\r\n<span style="text-decoration: underline;">Cosa Fare</span>: fare comfort è un percorso a ritroso, che parte dal bisogno di un clima su misura, passa attraverso la messa a fuoco della soluzione e si completa con la fornitura di beni e servizi, dalla piccola impiantistica domestica, fino ai grandi impianti con produzione centralizzata e gestione autonoma del calore.\r\n\r\n<span style="text-decoration: underline;">Come Fare</span>: non basta il prodotto migliore, ma è indispensabile la migliore risposta a specifici bisogni; <b>DAE ENERGIA</b> propone prodotti di altissima qualità, ma che  vengono integrati in un ottica di efficienza, flessibilità e innovazione, con competenza ed esperienza.\r\n\r\n<span style="text-decoration: underline;">Con chi Fare</span>: <b>DAE ENERGIA</b> é particolarmente orientata a soddisfare le specifiche necessità degli operatori del settore ed in particolare: <b>il progettista</b>: nell’individuazione della migliore soluzione impiantistica che meglio risponda alle specifiche esigenze del committente; <b>l’installatore</b>: nella fornitura di beni e servizi dedicati durante la fase di realizzazione dell’impianto; <b>l’utente finale</b>: con un servizio di assistenza altamente qualificato e capillare.\r\n\r\nLa professionalità di un team di lavoro altamente specializzato, l’affidabilità di prodotti caratterizzati da elevati livelli di tecnologia, la completezza di un’offerta che si impone come primario obiettivo un Comfort su misura e sostenibile, rendono <b>DAE ENERGIA</b> un partner attendibile e competente che si fregia, meritatamente, di offrire soluzioni mirate, concrete ed efficaci nell’attuale scenario della climatizzazione.\r\n\r\nPresentiamo qui alcuni dei nostri modi di <b>Fare Comfort</b> che sono il nostro biglietto da visita per chi, come noi, crede ancora che la tecnologia debba accompagnarsi a semplicità e creatività.', 'Azienda', '', 'publish', 'closed', 'closed', '', 'azienda-2', '', '', '2014-01-13 11:30:33', '2014-01-13 10:30:33', '', 0, 'http://www.daeitaly.com/?page_id=17', 0, 'page', '', 0),
