(295, 1, '2014-02-04 17:10:30', '2014-02-04 16:10:30', 'MODULO TERMICO PREFABBRICATO IN STRUTTURA DI CONTENIMENTO DA ESTERNO, posizionabile a cielo aperto in conformità alla Norme di Prevenzione Incendi (D.M. 12-04-96), adatto a contenere generatori a condensazione a gas metano e relative apparecchiature di servizio dell''impianto di riscaldamento. Involucro in lamiera antiriflesso che garantisce un''ottima resistenza alla corrosione, anche in ambiente marino.\r\n\r\nLa STRUTTURA DEL MODULO presenta le seguenti caratteristiche:\r\n\r\n- Pannelli esterni tipo sandwich;\r\n\r\n- Profili esterni in lamiera zincata verniciata;\r\n\r\n- Pannelli interni tipo sandwich;\r\n\r\n- Pannello base rivestito con lamiera di calpestio;\r\n\r\n- Coibentazione interna nei pannelli sandwich con lana di roccia incombustibile Classe A1 (DIN 4102) incombustibile Classe 0 (ISO-DIS 1182.2) EUROCLASSE: A1, spessore complessivo 50 mm;\r\n\r\n- Basamento in acciaio zincato;\r\n\r\n- Basamento con golfari per agevolare il sollevamento ed il trasporto;\r\n\r\n- Porta frontale con sistema di apertura standard dotata di maniglia con chiave;\r\n\r\n- Griglia/e di areazione dimensionata secondo D.M. 12-04-96;\r\n\r\n- Rete antitopo applicata a griglie di areazione;\r\n\r\n- Altre pareti tutte piene.', 'Roof Top', '', 'publish', 'closed', 'closed', '', 'roof-top', '', '', '2014-04-16 16:23:46', '2014-04-16 14:23:46', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=295', 0, 'prodotti', '', 0),
