(132, 1, '2014-01-13 11:14:39', '2014-01-13 10:14:39', '<b>MDG</b> è un sistema di regolazione di facile uso per il controllo delle condizioni termo igrometriche ambientali, sia in riscaldamento che raffrescamento, con possibilità di gestire più zone in maniera indipendente. Il sistema è costituito da uno o più termostati ambiente interconnessi tramite un bus locale, ognuno adibito al controllo della zona dove viene installato.', 'Termoregolazione ambiente MDG', '', 'publish', 'closed', 'closed', '', 'termoregolazione-ambiente', '', '', '2015-03-23 15:05:54', '2015-03-23 14:05:54', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=132', 0, 'prodotti', '', 0),
