(35, 1, '2014-01-29 11:24:02', '2013-12-10 13:16:31', 'DAE SRL è una realtà industriale nata alla fine degli anni ''90 per lo sviluppo e la produzione di elettronica custom e sistemi di automazione industriale. In considerazione della sempre più capillare diffusione di impianti a contabilizzazione in tutta Europa, sia per riscaldamento che raffrescamento, dal 2009 DAE Energia propone una completa gamma di moduli per la contabilizzazione, progettati e assemblati internamente.\r\n\r\nGrazie al know-how acquisito negli anni, con un ufficio tecnico dedicato e di assoluta competenza, è stato possibile sviluppare ed ingegnerizzare una serie di contatori di energia ad ultrasuoni per rispondere alle maggiori richieste del mercato. Tutti i contatori vengono calibrati, verificati e certificati nel laboratorio metrologico DAE secondo la normativa EN1434 vigente. Oltre ai propri strumenti di misura, DAE Energia è impegnata nella progettazione di contatori di energia customizzati per conto terzi.', 'Chi siamo', '', 'publish', 'closed', 'open', '', 'chi-siamo', '', '', '2014-01-21 20:20:44', '2014-01-21 19:20:44', '', 0, 'http://www.daeitaly.com/?page_id=35', 0, 'page', '', 0),
