(102, 1, '2014-01-08 08:27:43', '2014-01-08 07:27:43', 'EasyClima00 è un satellite d’utenza per riscaldamento e raffrescamento, predisposto per telelettura remota, senza produzione di acs. Configurazione senza circolatore per circuito d’appartamento, con contatore ad ultrasuoni certificato MID. Ogni satellite Dae Energia può essere provvisto di sistema Carta Prepagata così da dedurre dal credito residuo della carta l’importo dovuto al consumo secondo il costo energetico unitario impostato.', 'Satellite da incasso EasyClima00', '', 'publish', 'closed', 'closed', '', 'satellite-da-incasso-easyclima00', '', '', '2014-03-26 11:56:10', '2014-03-26 10:56:10', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=102', 0, 'prodotti', '', 0),
