(136, 1, '2014-01-13 11:19:44', '2014-01-13 10:19:44', 'La tecnologia “Full Inverter” caratterizza la proposta DAE Energia per quanto riguarda le pompe di calore: inverter BLDC, software di telecontrollo e gestione le pongono ai massimi vertici tecnologici del settore. Gamma di pompe di calore geotermiche acqua/acqua, per applicazioni residenziali, con produzione integrata di acqua calda sanitaria. L’elevata modularità consente utilizzi con impianti a sonde geotermiche o con acqua di falda. L’alta efficienza permette di garantire le migliori condizioni di comfort ambientale e la produzione di ACS senza l’utilizzo di resistenze elettriche ausiliarie. Pompa di calore aerotermica splittata polivalente, per applicazioni residenziali, con produzione di acqua calda sanitaria in recupero totale. Grazie alla gestione prioritaria dell’ACS prodotta in modalità di recupero totale durante la fase estiva, sono possibili elevati valori di rendimento in ogni modalità di utilizzo.', 'Pompe di calore', '', 'publish', 'closed', 'closed', '', 'pompe-di-calore', '', '', '2014-05-29 17:34:49', '2014-05-29 15:34:49', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=136', 0, 'prodotti', '', 0),
