(129, 1, '2014-02-03 11:58:58', '2014-01-10 17:00:48', '<b>CEILING-RAY</b> una soluzione innovativa per la climatizzazione ambientale che consiste in un pannello in cartongesso o materiale similare (grafite, fibrogesso), all’interno del quale sono alloggiati i circuiti idraulici, e da uno strato di materiale isolante con funzioni di isolamento termico, acustico o entrambe. All’interno della struttura del pannello radiante è inserito il collettore per l’alimentazione dei circuiti. La gamma è costituita da pannelli radianti standard, ma grazie alla loro logica costruttiva è possibile realizzare soluzioni personalizzate con caratteristiche costruttive e dimensionali legate alle specifiche esigenze del cliente.\r\n\r\nPannello dotato di <b><span style="text-decoration: underline;">COLLETTORE INTERNO </span></b>(versione PRESS) che consente di avere un tubo di diametro ridotto annegato nel gesso e contemporaneamente le uscite di lato in multistrato 16 mm per essere allacciato idraulicamente mediante raccorderia a pressare.\r\n\r\nDimensioni:  200x120 100x120 60x120 60x100 50x120 cm (versione con lamelle di alluminio)\r\n\r\nDimensioni:  250x120 125x120 200x120 100x120 60x120 60x100 50x120\r\n\r\nPasso:  5  7.5  10  15 cm\r\n\r\nTubazione interna:  6x1  8x1  10x1  12x1 mm\r\n\r\nTubazione in uscita: 14-16 mm Multistrato o pex (versione con collettore interno)\r\n\r\nRese termiche: Università DFT Padova , WSPLab Stuttgart\r\n\r\nStrato isolante<i> </i>: 30-100 mm EPS, lana di roccia, poliuretano', 'Ceiling-Ray soffitto radiante', '', 'publish', 'closed', 'closed', '', 'soffitto-radiante-ceiling-ray', '', '', '2015-03-23 15:10:59', '2015-03-23 14:10:59', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=129', 0, 'prodotti', '', 0),
(237, 1, '2014-01-30 09:48:24', '2014-01-30 08:48:24', 'QuickClima TP Twin Plate is a wall mounting HIU heating system that has been designed to provide independent and instantaneous domestic hot water with electronic thermostatic control and high efficiency heating.  The system suits a variety of applications such as small flats, communal housing developments, sheltered accommodation. The QuickClima TP is the complete solution for hot water and space heating in HIU heating systems where DHW is provided instantaneously. Heating is provided via a plate heat exchanger, which separates primary and apartment circuits, and circulation pump. A single plate unit SP is also available. The SP is equipped with a three-way valve allowing to switch from heating to dhw production (priority).', 'QuickClima TP-SP', '', 'publish', 'closed', 'closed', '', 'quickclima', '', '', '2014-02-03 16:00:50', '2014-02-03 15:00:50', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=237', 0, 'prodotti', '', 0),
(238, 1, '2014-01-30 09:58:06', '2014-01-30 08:58:06', 'Two are the paths to excellence.\r\nOne goes through one''s own tragedies, the other one through somebody else''s.\r\nThe first is the most effective, the second, by far, the least painful', 'Home', '', 'inherit', 'open', 'open', '', '235-autosave-v1', '', '', '2014-01-30 09:58:06', '2014-01-30 08:58:06', '', 235, 'http://www.daeitaly.com/235-autosave-v1/', 0, 'revision', '', 0),
