(99, 1, '2013-12-19 15:50:32', '2013-12-19 14:50:32', 'Le unità di ventilazione HCV sono apparecchiature di tipo verticale pensile per applicazioni domestiche. Il modello HCV 5 soddisfa le esigenze di ventilazione per abitazioni fino a 260 m2 , in funzione della perdita di carico del sistema di distribuzione in ambiente. Le dimensioni contenute permettono una facile installazione in ambienti angusti come ripostigli, vani di disbrigo oppure nicchie dietro porte scorrevoli.', 'Unità di ventilazione HCV5', '', 'publish', 'closed', 'closed', '', 'unita-di-ventilazione-fino-a-500-m3h', '', '', '2015-03-23 15:17:35', '2015-03-23 14:17:35', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=99', 0, 'prodotti', '', 0),
(100, 1, '2013-12-19 15:50:52', '2013-12-19 14:50:52', 'Le unità di ventilazione HCH sono apparecchiature per applicazioni domestiche di tipo orizzontale, progettate per essere installate nel sottotetto, controsoffitto o in un locale tecnico. La gamma comprende i modelli HCH 5 e HCH 8 che soddisfano le esigenze di ventilazione per abitazioni fino a 280 e 475 m2 rispettivamente, in funzione della perdita di carico del sistema di distribuzione in ambiente.', 'Unità di ventilazione HCH', '', 'publish', 'closed', 'closed', '', 'unita-di-ventilazione-fino-a-800-m3h', '', '', '2015-03-23 15:26:14', '2015-03-23 14:26:14', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=100', 0, 'prodotti', '', 0),
