(104, 1, '2014-01-08 08:30:31', '2014-01-08 07:30:31', 'EasyClima10 è un satellite d’utenza per riscaldamento e raffrescamento, predisposto per telelettura remota, senza produzione di acs. Configurazione con circolatore per circuito d’appartamento, entrambe con contatore ad ultrasuoni certificato MID. Ogni satellite Dae Energia può essere provvisto di sistema Carta Prepagata così da dedurre dal credito residuo della carta l’importo dovuto al consumo secondo il costo energetico unitario impostato.', 'Satellite da incasso EasyClima10', '', 'publish', 'closed', 'closed', '', 'satellite-da-incasso-easyclima10', '', '', '2014-03-26 11:55:12', '2014-03-26 10:55:12', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=104', 0, 'prodotti', '', 0),
