(195, 1, '2015-03-23 15:26:16', '2015-03-23 14:26:16', '<p>Le unità di ventilazione HCH sono apparecchiature per applicazioni domestiche di tipo orizzontale, progettate per essere installate nel sottotetto, controsoffitto o in un locale tecnico. La gamma comprende i modelli HCH 5 e HCH 8 che soddisfano le esigenze di ventilazione per abitazioni fino a 280 e 475 m2 rispettivamente, in funzione della perdita di carico del sistema di distribuzione in ambiente.</p>\n', 'Unità di ventilazione HCH', '', 'inherit', 'open', 'open', '', '100-autosave-v1', '', '', '2015-03-23 15:26:16', '2015-03-23 14:26:16', '', 100, 'http://www.daeitaly.com/100-autosave-v1/', 0, 'revision', '', 0);
