(194, 1, '2015-03-23 15:17:38', '2015-03-23 14:17:38', '<p>Le unità di ventilazione HCV sono apparecchiature di tipo verticale pensile per applicazioni domestiche. Il modello HCV 5 soddisfa le esigenze di ventilazione per abitazioni fino a 260 m2 , in funzione della perdita di carico del sistema di distribuzione in ambiente. Le dimensioni contenute permettono una facile installazione in ambienti angusti come ripostigli, vani di disbrigo oppure nicchie dietro porte scorrevoli.</p>\n', 'Unità di ventilazione HCV5', '', 'inherit', 'open', 'open', '', '99-autosave-v1', '', '', '2015-03-23 15:17:38', '2015-03-23 14:17:38', '', 99, 'http://www.daeitaly.com/99-autosave-v1/', 0, 'revision', '', 0),
(197, 1, '2014-04-03 09:24:52', '2014-04-03 07:24:52', 'La tecnologia “Full Inverter” caratterizza la proposta DAE Energia per quanto riguarda le pompe di calore: inverter BLDC, software di telecontrollo e gestione le pongono ai massimi vertici tecnologici del settore. Gamma di pompe di calore geotermiche acqua/acqua, per applicazioni residenziali, con produzione integrata di acqua calda sanitaria. L’elevata modularità consente utilizzi con impianti a sonde geotermiche o con acqua di falda. L’alta efficienza permette di garantire le migliori condizioni di comfort ambientale e la produzione di ACS senza l’utilizzo di resistenze elettriche ausiliarie. <b>P</b>ompa di calore aerotermica splittata polivalente, per applicazioni residenziali, con produzione di acqua calda sanitaria in recupero totale. Grazie alla gestione prioritaria dell’ACS prodotta in modalità di recupero totale durante la fase estiva, sono possibili elevati valori di rendimento in ogni modalità di utilizzo.', 'Pompe di calore', '', 'inherit', 'open', 'open', '', '136-autosave-v1', '', '', '2014-04-03 09:24:52', '2014-04-03 07:24:52', '', 136, 'http://www.daeitaly.com/136-autosave-v1/', 0, 'revision', '', 0),
(198, 1, '2015-03-23 15:05:57', '2015-03-23 14:05:57', '<p><b>MDG</b> è un sistema di regolazione di facile uso per il controllo delle condizioni termo igrometriche ambientali, sia in riscaldamento che raffrescamento, con possibilità di gestire più zone in maniera indipendente. Il sistema è costituito da uno o più termostati ambiente interconnessi tramite un bus locale, ognuno adibito al controllo della zona dove viene installato.</p>\n', 'Termoregolazione ambiente MDG', '', 'inherit', 'open', 'open', '', '132-autosave-v1', '', '', '2015-03-23 15:05:57', '2015-03-23 14:05:57', '', 132, 'http://www.daeitaly.com/132-autosave-v1/', 0, 'revision', '', 0),
(334, 1, '2015-03-23 15:06:06', '2015-03-23 14:06:06', '<p>This is a custom designed electronic control system for heating and cooling applications. The system is suitable to control the room temperature and humidity by modulating the water temperature (outdoor temperature compensation) feeding radiators, fancoil, undefloor circuits atc. It also allows the control of a domestic water storage.  It includes all the measurement and control circuits to drive pumps, valves and other devices used in such applications. It also permits the remote management via bus or gsm module.</p>\n', 'Control System MDG', '', 'inherit', 'closed', 'closed', '', '264-autosave-v1', '', '', '2015-03-23 15:06:06', '2015-03-23 14:06:06', '', 264, 'http://www.daeitaly.com/264-autosave-v1/', 0, 'revision', '', 0),
(335, 1, '2015-03-23 15:08:20', '2015-03-23 14:08:20', '<p><b>CEILING-RAY</b> una soluzione innovativa per la climatizzazione ambientale che consiste in un pannello in cartongesso o materiale similare (grafite, fibrogesso), all’interno del quale sono alloggiati i circuiti idraulici, e da uno strato di materiale isolante con funzioni di isolamento termico, acustico o entrambe. All’interno della struttura del pannello radiante è inserito il collettore per l’alimentazione dei circuiti. La gamma è costituita da pannelli radianti standard, ma grazie alla loro logica costruttiva è possibile realizzare soluzioni personalizzate con caratteristiche costruttive e dimensionali legate alle specifiche esigenze del cliente.</p>\n<p>Pannello dotato di <b><span style="text-decoration: underline;">COLLETTORE INTERNO </span></b>(versione PRESS) che consente di avere un tubo di diametro ridotto annegato nel gesso e contemporaneamente le uscite di lato in multistrato 16 mm per essere allacciato idraulicamente mediante raccorderia a pressare.</p>\n<p>Dimensioni:  200x120 100x120 60x120 60x100 50x120 cm (versione con lamelle di alluminio)</p>\n<p>Dimensioni:  250x120 125x120 200x120 100x120 60x120 60x100 50x120</p>\n<p>Passo:  5  7.5  10  15 cm</p>\n<p>Tubazione interna:  6x1  8x1  10x1  12x1 mm</p>\n<p>Tubazione in uscita: 14-16 mm Multistrato o pex (versione con collettore interno)</p>\n<p>Rese termiche: Università DFT Padova , WSPLab Stuttgart</p>\n<p>Strato isolante<i> </i>: 30-100 mm EPS, lana di roccia, poliuretano</p>\n', 'Ceiling-Ray soffitto radiante', '', 'inherit', 'closed', 'closed', '', '129-autosave-v1', '', '', '2015-03-23 15:08:20', '2015-03-23 14:08:20', '', 129, 'http://www.daeitaly.com/129-autosave-v1/', 0, 'revision', '', 0),
(139, 1, '2014-01-13 11:22:59', '2014-01-13 10:22:59', '', 'Sistemi Solari', '', 'inherit', 'open', 'open', '', 'sistemi-solari', '', '', '2014-01-13 11:22:59', '2014-01-13 10:22:59', '', 138, 'http://www.daeitaly.com/wp-content/uploads/2014/01/Sistemi-Solari.jpg', 0, 'attachment', 'image/jpeg', 0),
(196, 1, '2014-01-23 18:01:30', '2014-01-23 17:01:30', 'DAE Energia propone soluzioni integrate di solare termico a circolazione forzata composte da un insieme di elementi necessari alla realizzazione dell’impianto che consentono una estrema flessibilità di installazione (grazie alle numerose combinazioni possibili realizzabili per soddisfare le specifiche esigenze di produzione di ACS e integrazione al riscaldamento). I collettori DAE Energia si addicono particolarmente alle installazioni in batteria per la realizzazione di impianti di media e grande potenza. L’alta qualità dei materiali impiegati e dei componenti oltre che alle elevate prestazioni, garantiscono affidabilità e durata nel tempo. Nei collettori DAE Energia PSX l’assorbitore è a superficie totale con giunto tecnico originale “OMEGA”, che consente un efficientissimo sfruttamento della superficie: i tubi collettori in rame risultano interamente avvolti in modo uniforme. Ciò evita le turbolenze d’aria nel collettore ottimizzando l’efficienza termica solare del vetro di copertura. Sono disponibili varie tipologie di accumulo inerziale, per sola acqua calda, per produzione integrata acs e riscaldamento per soddisfare le più svariate esigenze. Giunto tecnico originale “OMEGA”. Tubi avvolti - Trasferimento del calore più efficiente', 'Pannelli solari', '', 'inherit', 'open', 'open', '', '138-autosave-v1', '', '', '2014-01-23 18:01:30', '2014-01-23 17:01:30', '', 138, 'http://www.daeitaly.com/138-autosave-v1/', 0, 'revision', '', 0),
(160, 1, '2014-01-21 20:20:44', '2014-01-21 19:20:44', 'DAE SRL è una realtà industriale nata alla fine degli anni ''90 per lo sviluppo e la produzione di elettronica custom e sistemi di automazione industriale. In considerazione della sempre più capillare diffusione di impianti a contabilizzazione in tutta Europa, sia per riscaldamento che raffrescamento, dal 2009 DAE Energia propone una completa gamma di moduli per la contabilizzazione, progettati e assemblati internamente.\r\n\r\nGrazie al know-how acquisito negli anni, con un ufficio tecnico dedicato e di assoluta competenza, è stato possibile sviluppare ed ingegnerizzare una serie di contatori di energia ad ultrasuoni per rispondere alle maggiori richieste del mercato. Tutti i contatori vengono calibrati, verificati e certificati nel laboratorio metrologico DAE secondo la normativa EN1434 vigente. Oltre ai propri strumenti di misura, DAE Energia è impegnata nella progettazione di contatori di energia customizzati per conto terzi.', 'Chi siamo', '', 'inherit', 'open', 'open', '', '35-revision-v1', '', '', '2014-01-21 20:20:44', '2014-01-21 19:20:44', '', 35, 'http://www.daeitaly.com/35-revision-v1/', 0, 'revision', '', 0),
