(158, 1, '2014-01-21 20:12:40', '2014-01-21 19:12:40', 'Due sono le vie che tutti gli uomini possono percorrere nella ricerca dell''eccellenza, una passa attraverso le disgrazie proprie, l''altra attraverso le disgrazie altrui: la prima è la più efficace, la seconda di gran lunga la meno dolorosa.\r\n\r\n<strong>POLIBIO (206-124 a.C.), Storie, I 35, (6-10)</strong>', 'Home', '', 'inherit', 'open', 'open', '', '18-revision-v1', '', '', '2014-01-21 20:12:40', '2014-01-21 19:12:40', '', 18, 'http://www.daeitaly.com/18-revision-v1/', 0, 'revision', '', 0),
(159, 1, '2014-01-21 20:20:18', '2014-01-21 19:20:18', 'DAE SRL è una realtà industriale nata alla fine degli anni ''90 per lo sviluppo e la produzione di elettronica custom e sistemi di automazione industriale. In considerazione della sempre più capillare diffusione di impianti a contabilizzazione in tutta Europa, sia per riscaldamento che raffrescamento, dal 2009 DAE Energia propone una completa gamma di moduli per la contabilizzazione, progettati e assemblati internamente.\n\nGrazie al Know-how acquisito negli anni, con un ufficio tecnico dedicato e di assoluta competenza, è stato possibile sviluppare ed ingegnerizzare una serie di contatori di energia ad ultrasuoni per rispondere alle maggiori richieste del mercato. Tutti i contatori vengono calibrati, verificati e certificati nel laboratorio metrologico DAE secondo la normativa EN1434 vigente. Oltre ai propri strumenti di misura, DAE Energia è impegnata nella progettazione di contatori di energia customizzati per conto terzi.', 'Chi siamo', '', 'inherit', 'open', 'open', '', '35-autosave-v1', '', '', '2014-01-21 20:20:18', '2014-01-21 19:20:18', '', 35, 'http://www.daeitaly.com/35-autosave-v1/', 0, 'revision', '', 0),
(141, 1, '2014-01-13 11:27:24', '2014-01-13 10:27:24', 'Il settore della climatizzazione vede sul mercato la presenza di diverse proposte che assemblano prodotti non perfettamente integrati tra loro. Da qui sorge la pressante richiesta da parte degli addetti ai lavori di sistemi che combinino efficienza e funzionalità ad economicità.\r\n\r\n<b>DAE ENERGIA</b>, realtà imprenditoriale giovane e dinamica, in ragione di uno staff competente e innovativo, ha il piacere di presentarVi il nuovo progetto <b>Fare Comfort</b>, approccio integrato e completo, tecnologicamente avanzato, nella fase di progettazione e realizzazione di impianti per la climatizzazione civile.\r\n\r\n<b>Fare Comfort</b> è un nuovo modo di concepire il sistema edificio impianto dove si prevedono tre livelli di attività:\r\n\r\n<span style="text-decoration: underline;">Cosa Fare</span>: fare comfort è un percorso a ritroso, che parte dal bisogno di un clima su misura, passa attraverso la messa a fuoco della soluzione e si completa con la fornitura di beni e servizi, dalla piccola impiantistica domestica, fino ai grandi impianti con produzione centralizzata e gestione autonoma del calore.\r\n\r\n<span style="text-decoration: underline;">Come Fare</span>: non basta il prodotto migliore, ma è indispensabile la migliore risposta a specifici bisogni; <b>DAE ENERGIA</b> propone prodotti di altissima qualità, ma che  vengono integrati in un ottica di efficienza, flessibilità e innovazione, con competenza ed esperienza.\r\n\r\n<span style="text-decoration: underline;">Con chi Fare</span>: <b>DAE ENERGIA</b> é particolarmente orientata a soddisfare le specifiche necessità degli operatori del settore ed in particolare: <b>il progettista</b>: nell’individuazione della migliore soluzione impiantistica che meglio risponda alle specifiche esigenze del committente; <b>l’installatore</b>: nella fornitura di beni e servizi dedicati durante la fase di realizzazione dell’impianto; <b>l’utente finale</b>: con un servizio di assistenza altamente qualificato e capillare.\r\n\r\nLa professionalità di un team di lavoro altamente specializzato, l’affidabilità di prodotti caratterizzati da elevati livelli di tecnologia, la completezza di un’offerta che si impone come primario obiettivo un Comfort su misura e sostenibile, rendono <b>DAE ENERGIA</b> un partner attendibile e competente che si fregia, meritatamente, di offrire soluzioni mirate, concrete ed efficaci nell’attuale scenario della climatizzazione.\r\n\r\nPresentiamo qui alcuni dei nostri modi di <b>Fare Comfort</b> che sono il nostro biglietto da visita per chi, come noi, crede ancora che la tecnologia debba accompagnarsi a semplicità e creatività.\r\n\r\n&nbsp;', 'Home', '', 'inherit', 'open', 'open', '', '18-revision-v1', '', '', '2014-01-13 11:27:24', '2014-01-13 10:27:24', '', 18, 'http://www.daeitaly.com/18-revision-v1/', 0, 'revision', '', 0),
