(144, 1, '2014-01-13 12:34:01', '2014-01-13 11:34:01', 'Pavimento radiante a secco in fibrogesso o legno cemento. Passo e diametro tubo variabili in base alle esigenze. Il pannello può essere dotato di strato isolante. La logica circuitale e la scanalatura lineare, bugnata, curvata o mista viene realizzata in base alle esigenze del cliente. Il pannello a secco per pavimento radiante DRY FLOOR attualmente viene prodotto nelle seguenti versioni:\r\n\r\nDRY FLOOR.ST STANDARD\r\nFibrogesso: 15 mm tubo: 10‐12 mm\r\n\r\nDRY FLOOR.HD GRANDI DIAMETRI\r\nFibrogesso: 18 mm tubo: 14‐17 mm\r\n\r\nDRY FLOOR.BIO BIOCOMPATIBILE\r\nLegonocemento: 18 mm tubo: 10‐12‐14‐17 mm\r\n\r\nDRY FLOOR.SILENT ACUSTICO\r\nFibrogesso: 15-18 mm tubo: 10‐12‐14‐17 mm', 'Dry Floor sistema a secco', '', 'publish', 'closed', 'closed', '', 'dry-floor-pavimento-a-secco', '', '', '2014-09-12 09:43:06', '2014-09-12 07:43:06', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=144', 0, 'prodotti', '', 0),
