(182, 1, '2014-01-22 16:15:27', '2014-01-22 15:15:27', 'Il contatore di calore ad ultrasuoni SND per riscaldamento e raffrescamento è stato progettato per misure di energia in ambito residenziale. Esso impiega l''ultima tecnologia per garantire alta qualità di misurazione e di eccezionale stabilità a lungo termine.\r\n\r\nQuesto strumento è il risultato della più moderna tecnologia disponibile per la contabilizzazione del calore.\r\n\r\nIl tubo per la misura del flusso è in ottone e non ha parti in movimento, pertanto è praticamente esente da manutenzione.\r\n\r\nCome sensori di temperatura vengono impiegate delle sonde ad alta qualità PT1000 per assicurare prestazioni in conformità alla norma EN 1434.\r\n\r\nPuò funzionare con temperatura dell''acqua fino a 95 ° C e pressione nominale di 16 bar con campo di misura della portata da 2 al 100% della portata massima.\r\n\r\nLe prestazioni non subiscono degradi durante il periodo di funzionamento garantendo così affidabilità e accuratezza della misura.\r\n\r\nLe sue dimensioni compatte lo rendono adatto anche ad installazioni dove lo spazio disponibile risulta esiguo: il modulo di calcolo può essere montato separato dal tubo di misura e installato a debita distanza (max 1,5 m).\r\n\r\nIl modulo di calcolo, con interfaccia di comunicazione M-BUS per la lettura remota, è dotato di ampio display per la visualizzazione della portata, temperature, consumi, tempi di funzionamento etc. E’ possibile inoltre visualizzare l’energia di consumo relativa agli 11 mesi antecedenti alla data attuale.', 'Contatori di calore ad ultrasuoni', '', 'publish', 'closed', 'closed', '', 'contatore-di-calore-ad-ultrasuoni', '', '', '2015-03-23 15:02:51', '2015-03-23 14:02:51', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=182', 0, 'prodotti', '', 0),
