(208, 1, '2014-01-28 17:42:14', '2014-01-28 16:42:14', 'DAE Srl was incorporated in 1999 for developing and manufacturing customized electronic boards and automation systems. In view of the recent highest growth rates for district heating and cooling in Europe, a new business unit, DAE Energia, has been started in 2008 to manufacture ultrasonic energy meters and Heat Interface Units. Thanks to specific electronic skills it has been possible to develop a range of cutting-edge meters to cover most of the market demands with reliable and competitive devices.\r\n\r\nDAE Energia has achieved this by maintaining a small "think tank" style technical team to design and engineer the product range and keeping an internal line for verification, testing and calibration of the instruments. Our Ultrasonic Energy Meters cater to the more demanding requirements that we propose mostly in the high-volume and price-sensitive market.\r\n\r\nFlexibility is our strength and we can provide Heat Interface Units designed and manufactured according to specific needs.', 'Company', '', 'publish', 'closed', 'closed', '', 'azienda-inglese', '', '', '2014-01-30 11:11:11', '2014-01-30 10:11:11', '', 0, 'http://www.daeitaly.com/?page_id=208', 0, 'page', '', 0),
