(241, 1, '2014-01-30 11:10:47', '2014-01-30 10:10:47', 'DAE Srl was incorporated in 1999 for developing and manufacturing customized electronic boards and automation systems. In view of the recent highest growth rates for district heating and cooling in Europe, a new business unit, DAE Energia, has been started in 2008 to manufacture ultrasonic energy meters and Heat Interface Units. Thanks to specific electronic skills it has been possible to develop a range of cutting-edge meters to cover most of the market demands with reliable and competitive devices.\n\nDAE Energia has achieved this by maintaining a small "think tank" style technical team to design and engineer the product range and keeping an internal line for verification, testing and calibration of the instruments. Our Ultrasonic Energy Meters cater to the more demanding requirements that we propose mostly in the high-volume and price-sensitive market.\n\nFlexibility is our strength and we can provide Heat Interface Units designed and manufactured according to specific needs.', 'Company', '', 'inherit', 'open', 'open', '', '208-autosave-v1', '', '', '2014-01-30 11:10:47', '2014-01-30 10:10:47', '', 208, 'http://www.daeitaly.com/208-autosave-v1/', 0, 'revision', '', 0),
