(243, 1, '2014-01-30 11:34:50', '2014-01-30 10:34:50', 'DAE Energia have established a strong foothold in a booming technology market for Ultrasonic Energy Meters (UEM) and heat Interface Units for heating and cooling applications.  DAE Energia’s success in taking advantage of this boom market is evidenced by their recent growth in sales and profitability. DAE have the capability of manufacturing UEM’s and HIU''s, but also to develop customized UEM''s to be manufactured by others. DAE Energia can provide the following services:\r\n<ul>\r\n	<li>Ultrasonic energy meter design according to the Standards EN 1434, OIML- D11, OIML R75-1, OIML R75-2, WELMEC, EN 13757, range from DN15 up to DN50</li>\r\n	<li>Microcontroller Firmware (software) development for energy meter measurements and calculation (flow, temperature, heating and cooling  energy)</li>\r\n	<li>Plastic box development</li>\r\n	<li>Windows software for calibration parameters editing (performance evaluation)</li>\r\n	<li>Ultrasonic sensor performance evaluation</li>\r\n	<li>Test at different temperatures, pressures and flowrates</li>\r\n	<li>Pre-compliance EMC test</li>\r\n	<li>Documentation suitable for MID approval</li>\r\n	<li>Production equipment</li>\r\n	<li>Test equipment</li>\r\n	<li>Laboratory equipment</li>\r\n	<li>Calibration equipment according to MID standards</li>\r\n	<li>Staff training</li>\r\n</ul>', 'Who we are', '', 'inherit', 'open', 'open', '', '211-autosave-v1', '', '', '2014-01-30 11:34:50', '2014-01-30 10:34:50', '', 211, 'http://www.daeitaly.com/211-autosave-v1/', 0, 'revision', '', 0),
