(254, 1, '2014-01-30 12:25:18', '2014-01-30 11:25:18', '', 'Temperature-Humidity Control System', 'MDG is a simple to use controller for regulation of temperature and humidity  in dwellings with one or more heating-cooling zones. The system not only makes it easier to achieve building regulation compliance, but also simplifies the installation process for the contractor. The system foresees one or more room controllers providing time and temperature control, which are wired on a BUS within the dwelling. For example, one of the room controllers can be installed in the living zone and the others in the sleeping zone, bathrooms etc.  The system consists of:\r\n• Control board MM4TTL\r\n• Room controller UA10/UA11\r\n• Room thermostat TSRM\r\n• 12 Vdc supplier ALI3010\r\n• Minimaster GSM100FP\r\n• Temperature probes\r\n• Remote monitoring system\r\n', 'publish', 'closed', 'closed', '', 'temperaturehumidity-control-system', '', '', '2014-02-03 15:46:49', '2014-02-03 14:46:49', '', 0, 'http://www.daeitaly.com/?post_type=categorie_prodotti&#038;p=254', 0, 'categorie_prodotti', '', 0),
(256, 1, '2014-01-30 12:28:38', '2014-01-30 11:28:38', '', 'Ultrasonic Energy Meters', 'The SND ultrasonic heat meter for heating and cooling is designed for residential metering applications. It employs the latest technology to guarantee durable high quality of measurement and outstanding long-term stability. This meter represents the trend of modem water and heat metering industry.\r\nThe sensor body is made by brass and has no moving parts, thus, it is virtually maintenance-free.  It uses high quality paired PT1000 temperature sensors to ensure performance according to the EN 1434 standard.\r\nIt can operate with water temperature up to 95 °C and nominal pressure of  16 bars its flow dynamic range is 100/2.  ', 'publish', 'closed', 'closed', '', 'ultrasonic-energy-meters', '', '', '2014-02-19 11:34:25', '2014-02-19 10:34:25', '', 0, 'http://www.daeitaly.com/?post_type=categorie_prodotti&#038;p=256', 0, 'categorie_prodotti', '', 0),
