(258, 1, '2014-01-30 12:35:44', '2014-01-30 11:35:44', '', 'Heat Interface Units', 'The DAE Heat Interface Units have been designed to provide apartments and communal housing developments with independent hot water and high efficiency heating.\r\nThe complete range of models available, suits a variety of applications such as:\r\n• Small flats\r\n• Communal housing developments\r\n• Large luxury apartments\r\n• Sheltered accommodation\r\nConsisting of a fast recovery hot water tank or high capacity heat exchanger, with a hydraulic header or plate heat exchanger, pump and mixing valve set for the heating circuit, DAE HIU''s offer a total heating solution. In addition to this the DAE units can provide direct control of underfloor heating without the need for any underfloor pumps, blending valves or mixing valves.\r\nThe design of the HIU''s provides the end user with the same autonomy as if they had their own boiler. This includes a meter for billing of energy usage and cold water consumption for each apartment or house, and where required it also offers a facility for both heating and cooling.\r\nDAE HIU''s draw energy from the main heating primary circuit delivered from a centralised plant room. This is in line with latest legislation encouraging centralised plant rather than the use of individual heating and hot water systems.\r\nThe integrated energy meter can be tailored to meet the requirements of the building operator and residents, ranging from simple read-only meters, to a complete remote billing solution using BUS communication to provide the end user with a fully itemised energy bill.', 'publish', 'closed', 'closed', '', 'heat-interface-units', '', '', '2014-02-19 11:33:32', '2014-02-19 10:33:32', '', 0, 'http://www.daeitaly.com/?post_type=categorie_prodotti&#038;p=258', 0, 'categorie_prodotti', '', 0),
(262, 1, '2014-02-03 11:18:23', '2014-02-03 10:18:23', 'The SND ultrasonic heat meter for heating and cooling is designed for residential metering applications. It employs the latest technology to guarantee durable high quality of measurement and outstanding long-term stability. This meter represents the trend of modem water and heat metering industry. The sensor body is made by brass and has no moving parts, thus, it is virtually maintenance-free. It uses high quality paired PT1000 temperature probes to ensure performance according to the EN 1434 standard. It can operate with water temperature up to 95 °C and nominal pressure of  16 bars its flow dynamic range is 100/2. The performance of its sensor does not degrade over time, thus, its overall system accuracy is guaranteed. Its compact size makes it suitable in even the smallest installation conditions and the measuring unit can be mounted separately from the electronic calculator (max. 1,5 m). The large display can be set to display flow velocity, flow total, working time, etc. The unit can be provided with M-BUS interface. The records of the last 11 month consumptions can be shown. The devices automatically commutates from winter to summer mode whenever both the probes measure a temperature lower than 25 °C. The heat meter is provided with a lithium battery (guaranteeing not less than 6 working years) the charge of which is displayed. When the battery is off the consumption records are always available in the EEPROM, but no further measurement is possible. As an option is provided an external 5 V dc auto-switching. The response time of the temperature sensors is 3 seconds, the sampling time of reading of the computing unit is every 8 seconds', 'Ultrasonic Energy Meters SND', '', 'publish', 'closed', 'closed', '', 'ultrasonic-energy-meters-snd', '', '', '2015-03-23 15:00:26', '2015-03-23 14:00:26', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=262', 0, 'prodotti', '', 0),
(264, 1, '2014-02-03 11:50:13', '2014-02-03 10:50:13', 'This is a custom designed electronic control system for heating and cooling applications. The system is suitable to control the room temperature and humidity by modulating the water temperature (outdoor temperature compensation) feeding radiators, fancoil, undefloor circuits atc. It also allows the control of a domestic water storage.  It includes all the measurement and control circuits to drive pumps, valves and other devices used in such applications. It also permits the remote management via bus or gsm module.', 'Control System MDG', '', 'publish', 'closed', 'closed', '', 'control-system-mdg', '', '', '2014-02-03 11:51:19', '2014-02-03 10:51:19', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=264', 0, 'prodotti', '', 0),
(266, 1, '2014-02-03 11:58:58', '2014-02-03 10:58:58', '<b>CEILING-RAY</b> is a new solution for heating and cooling. It consists of a plasterboard panel containing the hydraulic circuits, supply line and the panels connection system, thus avoiding any sort of service surface external to the panels. Standard panels are available, but it is possible to meet any request to meet specific project needs. The system can be easily controlled by the MDG control system.', 'Ceiling Ray', '', 'publish', 'closed', 'closed', '', 'ceiling-ray', '', '', '2014-02-03 12:43:28', '2014-02-03 11:43:28', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=266', 0, 'prodotti', '', 0),
