(269, 1, '2014-02-03 12:29:18', '2014-02-03 11:29:18', 'EnerClima is a wall mounting (WM) or floor standing (FS) terminal for district heating plants for heating, cooling and domestic hot water production thanks to its 60, 90 or 150 litre storage, and ready for remote reading. The primary hot fluid is provided by a central boiler that supplies all units through a main pump. A header or a plate heat exchanger is placed between the primary and secondary circuits in order to separate them and allow an independent regulation in each apartment, thus simplifying the design and installation. A variable pump is used on each secondary circuit to ensure proper operation and water flow: the system allows to set the temperature gradient of the apartment circuit for a better comfort control together with electric energy saving. The EnerClima is provided with an electronic controller that can be either an ON-OFF type or a climatic type according to the model. A heat meter in compliance with MID standards and nominal flow rate of 1.5 m3/h, provides consumption measurement for both heating and domestic hot water. The unit can be fitted with an additional meter for water consumption monitoring and has been developed to permit the remote consumption download and monitoring, alarms and diagnostic.', 'EnerClima WM and FS', '', 'publish', 'closed', 'closed', '', 'enerclima-wm-and-fs', '', '', '2014-02-03 12:33:07', '2014-02-03 11:33:07', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=269', 0, 'prodotti', '', 0),
(270, 1, '2014-02-03 12:46:09', '2014-02-03 11:46:09', 'The ESC Satellite heating unit provides indirect heating or cooling, designed for wall-mounting or built-in installation. The domestic hot water is granted by a communal tank in the boiler room. Two models are available, with and without circulation pump. An ultrasonic heat meter, MID approved, guarantees an accurate consumption metering. All DAE satellites can be equipped with “Pay As You Go” system that allows end users to pay their energy bill with a rechargeable prepaid card.', 'EasyClima 00 and EasyClima 10', '', 'publish', 'closed', 'closed', '', 'easyclima-00-and-easyclima-10', '', '', '2014-02-26 10:29:01', '2014-02-26 09:29:01', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=270', 0, 'prodotti', '', 0),
