(311, 1, '2014-05-29 17:37:09', '2014-05-29 15:37:09', 'Dal 1° giugno 2014 arriva il <strong>“Libretto di impianto per la climatizzazione”</strong> con i seguenti obblighi:\r\n\r\n1.deve essere redatto per tutti gli impianti, esistenti e di nuova installazione\r\n2.deve essere redatto per tutti gli impianti di climatizzazione invernale e/o estiva, indipendentemente dalla potenza termica\r\n3.deve essere redatto dall’installatore per i nuovi impianti e dal responsabile (o terzo responsabile) per quelli esistenti\r\n4.deve essere disponibile in forma cartacea o elettronica\r\n5.devono essere stampate e conservate, anche in formato elettronico, le schede pertinenti lo specifico impianto\r\n6.deve avere come allegato il vecchio libretto dell’impianto e di centrale\r\n7.deve essere consegnato in caso di alienazione del bene\r\n8.deve essere conservato per almeno 5 anni dalla dismissione del bene\r\n9.devono essere aggiornati i vecchi allegati del D.M. 17/03/03 (Allegati I,II) e del D.Lgs 19/08/05 n. 192 (Allegati F e G) con i nuovi allegati conformi al D.M. 10 febbraio 2014.\r\n\r\nInoltre, dal 1° giugno 2014 il manutentore deve redigere specifici <strong>“Rapporti di Controllo”</strong> in caso di interventi di controllo e manutenzione su impianti di climatizzazione invernale di potenza utile nominale superiore ai 10 kW, e di climatizzazione estiva superiore ai 12 kW, con o senza produzione di acqua calda sanitaria.\r\nPer redigere i Rapporti di Controllo dovranno essere utilizzati i nuovi modelli conformi agli allegati II,III,IV, e V del D.M. 10/02/2014 (che sostituiscono i vecchi allegati F e G del D.Lgs. 192/2005) da spedire prioritariamente, con strumenti informatici, all’Autorità competente.\r\nI modelli da utilizzare per il rapporto di efficienza energetica sono suddivisi per tipologie impiantistiche :\r\n\r\n1.Tipo 1 - Impianti con cogeneratore di calore di fiamma (Allegati II)\r\n2.Tipo 2 - Gruppi Frigo – Impianti con macchine frigorifere/pompe di calore (Allegato III)\r\n3.Tipo 3 - Scambiatori – Impianti alimentati da teleriscaldamento (Allegato IV)\r\n4.Tipo 4 - Impianti cogenerativi (Allegato V)\r\n\r\nI documenti sopra descritti sono disponibili all’interno del nostro sito all’interno di ogni prodotto interessato\r\n\r\n&nbsp;\r\n\r\n&nbsp;', 'News', '', 'inherit', 'closed', 'closed', '', '15-revision-v1', '', '', '2014-05-29 17:37:09', '2014-05-29 15:37:09', '', 15, 'http://www.daeitaly.com/15-revision-v1/', 0, 'revision', '', 0),
