(327, 1, '2015-02-24 12:31:35', '2015-02-24 11:31:35', 'Il ripartitore di calore RFM è un dispositivo elettronico che quantifica, tramite un parametro definito “unità di consumo”, la quota energetica consumata da una singola unità riscaldante. Ciò rende possibile, in un edificio multifamiliare con impianto di riscaldamento centralizzato, calcolare l’effettivo consumo di ogni singolo radiatore, per ogni singolo appartamento.\r\nE’ necessario che il ripartitore sia abbinato ad una valvola termostatica che consente, in automatico, la regolazione della temperatura ambiente in base al valore impostato.\r\nE'' un ripartitore radio per rilievo consumi termici certificato secondo norma EN 834 con trasmissione dei dati Wireless M-Bus EN 13757 a 868 MHz con potenza di trasmissione ≤ 10 mW e frequenza di trasmissione impostabile. E’ provvisto di display a 6 cifre per lettura diretta. Il ripartitore dispone di due sensori di temperatura, uno anteriore, per il rilievo della temperatura ambiente, ed uno sul retro per la temperatura del corpo scaldante. La precisione di lettura è 1%, con commutazione automatica ad un sensore in condizioni critiche di rilievo. La programmazione/lettura è possibile tramite apposita chiavetta di configurazione con interfaccia ottica. Un sigillo con allarme smontaggio e memorizzazione data, rileva eventuali manomissioni del dispositivo. I dati di consumo vengono rilevati con cadenza giornaliera e con storico mensile. E’ inoltre possibile la rilevazione storica dei consumi e delle temperature medie fino a 24 mesi precedenti. La batteria al litio garantisce una durata standard di 10 anni. Il sistema è adatto per diverse tipologie d’impianto centralizzato: a 2 tubi / monotubo. Il range di temperatura per corretto funzionamento (Tminima per inizio conteggio - Tmassima) è di 21÷90 °C. Può essere installato su radiatori di svariate potenze fino a 12500 W.\r\nPer installazioni in spazi angusti è disponibile una versione di ripartitore radio con sensore remoto. In questi casi, ripartitore e sonda possono essere installati separatamente, col il sensore remoto a contatto con la superficie del corpo scaldante.', 'Ripartitore', '', 'publish', 'closed', 'closed', '', 'ripartitore', '', '', '2015-02-24 12:34:25', '2015-02-24 11:34:25', '', 0, 'http://www.daeitaly.com/?post_type=prodotti&#038;p=327', 0, 'prodotti', '', 0),
(328, 1, '2015-02-24 12:30:32', '2015-02-24 11:30:32', '', 'HYD', '', 'inherit', 'closed', 'closed', '', 'hyd', '', '', '2015-02-24 12:30:32', '2015-02-24 11:30:32', '', 327, 'http://www.daeitaly.com/wp-content/uploads/2015/02/HYD.bmp', 0, 'attachment', 'image/bmp', 0),
(333, 1, '2015-03-23 15:00:29', '2015-03-23 14:00:29', '<p>The SND ultrasonic heat meter for heating and cooling is designed for residential metering applications. It employs the latest technology to guarantee durable high quality of measurement and outstanding long-term stability. This meter represents the trend of modem water and heat metering industry. The sensor body is made by brass and has no moving parts, thus, it is virtually maintenance-free. It uses high quality paired PT1000 temperature probes to ensure performance according to the EN 1434 standard. It can operate with water temperature up to 95 °C and nominal pressure of  16 bars its flow dynamic range is 100/2. The performance of its sensor does not degrade over time, thus, its overall system accuracy is guaranteed. Its compact size makes it suitable in even the smallest installation conditions and the measuring unit can be mounted separately from the electronic calculator (max. 1,5 m). The large display can be set to display flow velocity, flow total, working time, etc. The unit can be provided with M-BUS interface. The records of the last 11 month consumptions can be shown. The devices automatically commutates from winter to summer mode whenever both the probes measure a temperature lower than 25 °C. The heat meter is provided with a lithium battery (guaranteeing not less than 6 working years) the charge of which is displayed. When the battery is off the consumption records are always available in the EEPROM, but no further measurement is possible. As an option is provided an external 5 V dc auto-switching. The response time of the temperature sensors is 3 seconds, the sampling time of reading of the computing unit is every 8 seconds</p>\n', 'Ultrasonic Energy Meters SND', '', 'inherit', 'closed', 'closed', '', '262-autosave-v1', '', '', '2015-03-23 15:00:29', '2015-03-23 14:00:29', '', 262, 'http://www.daeitaly.com/262-autosave-v1/', 0, 'revision', '', 0),
(329, 1, '2015-02-24 12:34:28', '2015-02-24 11:34:28', '<p>Il ripartitore di calore RFM è un dispositivo elettronico che quantifica, tramite un parametro definito “unità di consumo”, la quota energetica consumata da una singola unità riscaldante. Ciò rende possibile, in un edificio multifamiliare con impianto di riscaldamento centralizzato, calcolare l’effettivo consumo di ogni singolo radiatore, per ogni singolo appartamento.<br />\nE’ necessario che il ripartitore sia abbinato ad una valvola termostatica che consente, in automatico, la regolazione della temperatura ambiente in base al valore impostato.<br />\nE'' un ripartitore radio per rilievo consumi termici certificato secondo norma EN 834 con trasmissione dei dati Wireless M-Bus EN 13757 a 868 MHz con potenza di trasmissione ≤ 10 mW e frequenza di trasmissione impostabile. E’ provvisto di display a 6 cifre per lettura diretta. Il ripartitore dispone di due sensori di temperatura, uno anteriore, per il rilievo della temperatura ambiente, ed uno sul retro per la temperatura del corpo scaldante. La precisione di lettura è 1%, con commutazione automatica ad un sensore in condizioni critiche di rilievo. La programmazione/lettura è possibile tramite apposita chiavetta di configurazione con interfaccia ottica. Un sigillo con allarme smontaggio e memorizzazione data, rileva eventuali manomissioni del dispositivo. I dati di consumo vengono rilevati con cadenza giornaliera e con storico mensile. E’ inoltre possibile la rilevazione storica dei consumi e delle temperature medie fino a 24 mesi precedenti. La batteria al litio garantisce una durata standard di 10 anni. Il sistema è adatto per diverse tipologie d’impianto centralizzato: a 2 tubi / monotubo. Il range di temperatura per corretto funzionamento (Tminima per inizio conteggio - Tmassima) è di 21÷90 °C. Può essere installato su radiatori di svariate potenze fino a 12500 W.<br />\nPer installazioni in spazi angusti è disponibile una versione di ripartitore radio con sensore remoto. In questi casi, ripartitore e sonda possono essere installati separatamente, col il sensore remoto a contatto con la superficie del corpo scaldante.</p>\n', 'Ripartitore', '', 'inherit', 'closed', 'closed', '', '327-autosave-v1', '', '', '2015-02-24 12:34:28', '2015-02-24 11:34:28', '', 327, 'http://www.daeitaly.com/327-autosave-v1/', 0, 'revision', '', 0),
(330, 1, '2015-03-23 15:01:34', '2015-03-23 14:01:34', '<p>Il contatore di calore ad ultrasuoni SND per riscaldamento e raffrescamento è stato progettato per misure di energia in ambito residenziale. Esso impiega l''ultima tecnologia per garantire alta qualità di misurazione e di eccezionale stabilità a lungo termine.</p>\n<p>Questo strumento è il risultato della più moderna tecnologia disponibile per la contabilizzazione del calore.</p>\n<p>Il tubo per la misura del flusso è in ottone e non ha parti in movimento, pertanto è praticamente esente da manutenzione.</p>\n<p>Come sensori di temperatura vengono impiegate delle sonde ad alta qualità PT1000 per assicurare prestazioni in conformità alla norma EN 1434.</p>\n<p>Può funzionare con temperatura dell''acqua fino a 95 ° C e pressione nominale di 16 bar con campo di misura della portata da 2 al 100% della portata massima.</p>\n<p>Le prestazioni non subiscono degradi durante il periodo di funzionamento garantendo così affidabilità e accuratezza della misura.</p>\n<p>Le sue dimensioni compatte lo rendono adatto anche ad installazioni dove lo spazio disponibile risulta esiguo: il modulo di calcolo può essere montato separato dal tubo di misura e installato a debita distanza (max 1,5 m).</p>\n<p>Il modulo di calcolo, con interfaccia di comunicazione M-BUS per la lettura remota, è dotato di ampio display per la visualizzazione della portata, temperature, consumi, tempi di funzionamento etc. E’ possibile inoltre visualizzare l’energia di consumo relativa agli 11 mesi antecedenti alla data attuale.</p>\n', 'Contatori di calore ad ultrasuoni', '', 'inherit', 'closed', 'closed', '', '182-autosave-v1', '', '', '2015-03-23 15:01:34', '2015-03-23 14:01:34', '', 182, 'http://www.daeitaly.com/182-autosave-v1/', 0, 'revision', '', 0);
