(2426, 1442315621, 'new', 'wfPluginUpgrade', 1, '093f7cb5e669e6f6e240b7682788e21b', '093f7cb5e669e6f6e240b7682788e21b', 'The Plugin "Anti-Malware and Brute-Force Security by ELI" needs an upgrade.', 'You need to upgrade "Anti-Malware and Brute-Force Security by ELI" to the newest version to ensure you have any security fixes the developer has released.', 'a:13:{s:4:"Name";s:44:"Anti-Malware and Brute-Force Security by ELI";s:9:"PluginURI";s:18:"http://gotmls.net/";s:7:"Version";s:7:"4.15.23";s:11:"Description";s:364:"This Anti-Virus/Anti-Malware plugin searches for Malware and other Virus like threats and vulnerabilities on your server and helps you remove them. It&#8217;s always growing and changing to adapt to new threats so let me know if it&#8217;s not working for you. <cite>Di <a href="http://wordpress.ieonly.com/category/my-plugins/anti-malware/">Eli Scheetz</a></cite>";s:6:"Author";s:87:"<a href="http://wordpress.ieonly.com/category/my-plugins/anti-malware/">Eli Scheetz</a>";s:9:"AuthorURI";s:61:"http://wordpress.ieonly.com/category/my-plugins/anti-malware/";s:10:"TextDomain";s:6:"gotmls";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:77:"<a href="http://gotmls.net/">Anti-Malware and Brute-Force Security by ELI</a>";s:10:"AuthorName";s:11:"Eli Scheetz";s:10:"pluginFile";s:69:"/web/htdocs/www.daeitaly.com/home/wp-content/plugins/gotmls/index.php";s:10:"newVersion";s:7:"4.15.30";}'),
