(2425, 1442315621, 'new', 'wfPluginUpgrade', 1, '526b2916a89927c4f154f32f2b8ed1d8', '526b2916a89927c4f154f32f2b8ed1d8', 'The Plugin "Akismet" needs an upgrade.', 'You need to upgrade "Akismet" to the newest version to ensure you have any security fixes the developer has released.', 'a:13:{s:4:"Name";s:7:"Akismet";s:9:"PluginURI";s:31:"http://akismet.com/?return=true";s:7:"Version";s:5:"2.5.9";s:11:"Description";s:527:"Used by millions, Akismet is quite possibly the best way in the world to <strong>protect your blog from comment and trackback spam</strong>. It keeps your site protected from spam even while you sleep. To get started: 1) Click the &#8220;Activate&#8221; link to the left of this description, 2) <a href="http://akismet.com/get/?return=true">Sign up for an Akismet API key</a>, and 3) Go to your Akismet configuration page, and save your API key. <cite>Di <a href="http://automattic.com/wordpress-plugins/">Automattic</a></cite>";s:6:"Author";s:65:"<a href="http://automattic.com/wordpress-plugins/">Automattic</a>";s:9:"AuthorURI";s:40:"http://automattic.com/wordpress-plugins/";s:10:"TextDomain";s:0:"";s:10:"DomainPath";s:0:"";s:7:"Network";b:0;s:5:"Title";s:53:"<a href="http://akismet.com/?return=true">Akismet</a>";s:10:"AuthorName";s:10:"Automattic";s:10:"pluginFile";s:72:"/web/htdocs/www.daeitaly.com/home/wp-content/plugins/akismet/akismet.php";s:10:"newVersion";s:5:"3.1.3";}'),
